import React, { useState } from "react";
import axios from "axios";
import "./Register.css";

const SignInRegister = () => {
  const [isSignIn, setIsSignIn] = useState(false);
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");

  const handleSignInClick = () => {
    setIsSignIn(false);
  };

  const handleSignUpClick = () => {
    setIsSignIn(true);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (isSignIn) {
      // Handle Sign In
      try {
        const response = await axios.post("https://your-api-url.com/signin", {
          email,
          password,
        });
        if (response.status === 200) {
          setSuccess("User signed in successfully");
          setError("");
        }
      } catch (err) {
        setError("Sign in failed");
        setSuccess("");
      }
    } else {
      // Handle Sign Up
      try {
        const response = await axios.post("https://your-api-url.com/register", {
          username,
          email,
          password,
        });
        if (response.status === 201) {
          setSuccess("User registered successfully");
          setError("");
        }
      } catch (err) {
        setError("Registration failed");
        setSuccess("");
      }
    }
  };

  return (
    <div className="body-img">
      <div className={`container ${isSignIn ? "right-panel-active" : ""}`}>
        <div className="container__form container--signup">
          <form className="form formScroll" id="form1" onSubmit={handleSubmit}>
            <h2 className="form__title">Sign Up</h2>
            {error && <p style={{ color: "red" }}>{error}</p>}
            {success && <p style={{ color: "green" }}>{success}</p>}
            <input
              type="text"
              placeholder="User"
              className="input"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              required
            />
            <input
              type="email"
              placeholder="Email"
              className="input"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <input
              type="password"
              placeholder="Password"
              className="input"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <button className="btn">Sign Up</button>
          </form>
        </div>
        <div className="container__form container--signin">
          <form className="form" id="form2" onSubmit={handleSubmit}>
            <h2 className="form__title">Sign In</h2>
            {error && <p style={{ color: "red" }}>{error}</p>}
            {success && <p style={{ color: "green" }}>{success}</p>}
            <input
              type="email"
              placeholder="Email"
              className="input"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <input
              type="password"
              placeholder="Password"
              className="input"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <button className="btn">Sign In</button>
          </form>
        </div>

        <div className="container__overlay">
          <div className="overlay">
            <div className="overlay__panel overlay--left">
              <button className="btn" id="signIn" onClick={handleSignInClick}>
                Sign In
              </button>
            </div>
            <div className="overlay__panel overlay--right">
              <button className="btn" id="signUp" onClick={handleSignUpClick}>
                Sign Up
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SignInRegister;
